import React from "react";

const Columns = props => {
  console.log(props.day1);
  var snow = "wi wi-day-snow size";
  return (
    <div className="col-sm-2 bor ">
      <p>Wed</p>
      <i className={snow} />
      <p>
        <span className="lead">
          {((props.day1.main.temp_max - 32) * 5) / 9}
        </span>
        &#176; &nbsp;&nbsp;
        <span className="text-muted">{props.day1.main.temp_min}</span>
        &#176;
      </p>
    </div>
  );
};
export default Columns;
